import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function InventoryPage() {
  const [products, setProducts] = useState([]);
  const [productsOnSale, setProductsOnSale] = useState([]);
  const [productsWithRebates, setProductsWithRebates] = useState([]);

  // Fetch all products and their availability
  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.get('http://localhost:3030/api/products/inventory');
        setProducts(response.data);
      } catch (error) {
        console.error('Error fetching products:', error);
      }
    };

    const fetchProductsOnSale = async () => {
      try {
        const response = await axios.get('http://localhost:3030/api/products/sale');
        setProductsOnSale(response.data);
      } catch (error) {
        console.error('Error fetching products on sale:', error);
      }
    };

    const fetchProductsWithRebates = async () => {
      try {
        const response = await axios.get('http://localhost:3030/api/products/rebates');
        setProductsWithRebates(response.data);
      } catch (error) {
        console.error('Error fetching products with rebates:', error);
      }
    };

    fetchProducts();
    fetchProductsOnSale();
    fetchProductsWithRebates();
  }, []);

  return (
    <div className="inventory-page">
      <h2>Inventory Page</h2>

      {/* Table of Products with Available Quantities */}
      <h3>All Products</h3>
      <table>
        <thead>
          <tr>
            <th>Product Name</th>
            <th>Price</th>
            <th>Available Quantity</th>
          </tr>
        </thead>
        <tbody>
          {products.map((product) => (
            <tr key={product.product_name}>
              <td>{product.product_name}</td>
              <td>{product.product_price}</td>
              <td>{product.available_quantity}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Bar Chart for Product Availability */}
      <h3>Product Availability Chart</h3>
      <ResponsiveContainer width="100%" height={400}>
        <BarChart data={products} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="product_name" />
          <YAxis />
          <Tooltip />
          <Legend />
          <Bar dataKey="available_quantity" fill="#8884d8" />
        </BarChart>
      </ResponsiveContainer>

      {/* Table of Products on Sale */}
      <h3>Products on Sale</h3>
      <table>
        <thead>
          <tr>
            <th>Product Name</th>
            <th>Price</th>
            <th>Available Quantity</th>
          </tr>
        </thead>
        <tbody>
          {productsOnSale.map((product) => (
            <tr key={product.product_name}>
              <td>{product.product_name}</td>
              <td>{product.product_price}</td>
              <td>{product.available_quantity}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Table of Products with Manufacturer Rebates */}
      <h3>Products with Manufacturer Rebates</h3>
      <table>
        <thead>
          <tr>
            <th>Product Name</th>
            <th>Price</th>
            <th>Available Quantity</th>
          </tr>
        </thead>
        <tbody>
          {productsWithRebates.map((product) => (
            <tr key={product.product_name}>
              <td>{product.product_name}</td>
              <td>{product.product_price}</td>
              <td>{product.available_quantity}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default InventoryPage;
